------------------------------

Jamie's Sugar Rush
Jamie Oliver investigates the huge contribution sugar is making to rising global health problems, with experts warning that excess sugar is as dangerous as alcohol and tobacco, contributing to huge rises in obesity and type 2 diabetes. He meets people suffering the devastating effects of type 2 diabetes, including leg amputation, and talks to a dentist who frequently has to remove milk and adult teeth from primary school children. Jamie analyses a typical day's food and drink and reveals how much sugar is getting into our healthy-looking foods without us realising. And he travels to Mexico, where more than two thirds of adults are obese or overweight and type 2 diabetes is the leading cause of death. Inspired by Mexico's soda tax of 10% on drinks with added sugar, he decides to introduce a surcharge on cold drinks with added sugar sold in his UK restaurants, with the money raised going to food education programmes.

